{"post_creation_date": "1413142552", "post_id": "829822330720341946_1034466", "post_media": {"hashtags": [{"indices": [289, 296], "text": "bogota"}, {"indices": [279, 288], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10725165_822157137830487_2027293232_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "We met each other in Santa Marta. We were both on holiday and had a friend in common, my cousin, and he introduced us\" / \"And in that moment\u2014he fell in love with me.\" / \"We're still just friends. She hasn't said yes to me yet. We're still in this. Six years. I'm not in a hurry.\"#HowWeMet #Bogota", "post_url": "http://instagram.com/p/uEHwNhRc-6/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1413055185", "post_id": "829089444681600735_1034466", "post_media": {"hashtags": [{"indices": [77, 83], "text": "china"}, {"indices": [67, 76], "text": "shanghai"}, {"indices": [57, 66], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xfa1/t51.2885-15/10729460_617788748329598_2009105409_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "\"I've known him for two weeks. We met in a karaoke bar.\" #HowWeMet #Shanghai #China", "post_url": "http://instagram.com/p/uBhHUNRc7f/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412959915", "post_id": "828290260076449348_1034466", "post_media": {"hashtags": [{"indices": [308, 312], "text": "nyc"}, {"indices": [298, 307], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xaf1/t51.2885-15/10693527_541342865966461_1797208718_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "\u201cWe work together. My first impression of him was that he was a little sassy.\u201d \u201cI liked her style. Very dark. She was wearing layers of black.\u201d \u201cHe was wearing a suit. Navy blue or black\u2026 always.\u201d \u201cI\u2019ve learned never to get as drunk as Bridget.\u201d \u201cI\u2019ve learned from Will how to get stuff for free.\u201d #HowWeMet #nyc", "post_url": "http://instagram.com/p/t-rZpixc5E/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412875236", "post_id": "827579925342310078_1034466", "post_media": {"hashtags": [{"indices": [202, 210], "text": "cardiff"}, {"indices": [192, 201], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10693428_908522695842098_592746034_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "Chris: \u201c15 years ago in a nightclub in Cardiff... I know it sounds daft, but it was like the whole room went back and there she was.\u201d Sian: \u201cI thought he was gay!\u201d (Both break into laughter.) #HowWeMet #Cardiff", "post_url": "http://instagram.com/p/t8J46xRc6-/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412786828", "post_id": "826838307643444536_1034466", "post_media": {"hashtags": [{"indices": [545, 552], "text": "bogota"}, {"indices": [535, 544], "text": "howwemet"}, {"indices": [553, 562], "text": "colombia"}], "photo_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xaf1/t51.2885-15/10724116_696522000443466_1725534966_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "\"We met 53 years ago in a restaurant called El Cisne. I came from school with some friends to drink coffee and he was there with his Spanish friends also drinking coffee. He sent me a card with a waitress, which said\u2026 what did the little card say?\" \"Mide y media de mi existencia por una caricia de amor \u2013 (translation) A measure and a half of my existence I would give for a loving caress.\" \"I returned him the card and said to the waitress \u201cPlease return this card to that man. I don\u2019t know him; he\u2019s European and probably married\u201d \n#HowWeMet #Bogota #Colombia", "post_url": "http://instagram.com/p/t5hQ9dxc04/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412700924", "post_id": "826117690145230596_1034466", "post_media": {"hashtags": [{"indices": [242, 250], "text": "cardiff"}, {"indices": [251, 257], "text": "wales"}, {"indices": [232, 241], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/10725022_311458742359973_1007212839_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "Gareth: \u201cWe met each other through a mutual friend. I never usually do coffee with a mate, but Wayne got me into it.\u201d \u201cMy group of mates say, 'men don\u2019t do coffee!' \u2014but I say: 'well, Wayne does.'\u201d \u201cWe\u2019re modern men\u2014who do coffee!\u201d #HowWeMet #Cardiff #Wales", "post_url": "http://instagram.com/p/t29amHxc8E/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412620206", "post_id": "825440579046722938_1034466", "post_media": {"hashtags": [{"indices": [55, 59], "text": "nyc"}, {"indices": [45, 54], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xfa1/t51.2885-15/10724723_809685099083723_2044867007_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "\"He didn't hit on me. It worked. Smart guy.\" #HowWeMet #nyc", "post_url": "http://instagram.com/p/t0jdVRRc16/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412565247", "post_id": "824979548373634464_1034466", "post_media": {"hashtags": [{"indices": [200, 209], "text": "howwemet"}], "photo_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xaf1/t51.2885-15/10643868_1470085839941501_1708805020_n.jpg"}], "video_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xaf1/t50.2886-16/10725786_441920225948199_1229206010_n.mp4"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "We gave ourselves a little photo assignment: Capture the stories and unique relationships of people in cafes from around the world. All this week, we'll show you what we found\u2014and invite you to join. #HowWeMet", "post_url": "http://instagram.com/p/ty6oc_xc2g/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412455083", "post_id": "824055426768555348_1034466", "post_media": {"hashtags": [{"indices": [177, 189], "text": "atstarbucks"}], "photo_loaded": [{"media_url": "http://scontent-a.cdninstagram.com/hphotos-xaf1/t51.2885-15/914409_706535429439093_1935095980_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "\u201cThose are the things you are going to take with you for the rest of your life.\u201d In Denver, a scooter club fueled by friendship and acceptance kickstarts their next adventure at#atStarbucks.\n\nSee the link in our bio to explore the films.", "post_url": "http://instagram.com/p/tvogtrxc1U/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
{"post_creation_date": "1412441322", "post_id": "823939991922397143_1034466", "post_media": {"hashtags": [{"indices": [181, 193], "text": "atstarbucks"}], "photo_loaded": [{"media_url": "http://scontent-a.cdninstagram.com/hphotos-xpa1/t51.2885-15/1389263_353600088138156_920161307_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "\u201cThey're ancient, extremely beautiful and we want to keep them the same way.\u201d A team dedicated to keeping Amsterdam's beautiful canals clean connect with others over a common cause #atStarbucks\n\nClick the link in our bio to explore the films.", "post_url": "http://instagram.com/p/tvOQ6mxc_X/", "post_user_owner": {"user_owner_id": "1034466", "user_owner_name": "Starbucks Coffee \u2615", "user_owner_screen_name": "starbucks", "user_owner_url": "https://instagram.com/starbucks"}}
