{"post_creation_date": "1413250963", "post_id": "830731754038971960_317742130", "post_media": {"hashtags": [{"indices": [-1, 9], "text": "nutrition"}, {"indices": [-1, 13], "text": "paleoapproved"}, {"indices": [-1, 6], "text": "fitspo"}, {"indices": [-1, 8], "text": "comebien"}, {"indices": [-1, 6], "text": "mexico"}, {"indices": [-1, 5], "text": "salud"}, {"indices": [-1, 13], "text": "healthychoice"}, {"indices": [-1, 12], "text": "dianaabreuhc"}, {"indices": [-1, 11], "text": "hamburguesa"}, {"indices": [-1, 11], "text": "cleaneating"}, {"indices": [-1, 11], "text": "crossfitter"}, {"indices": [-1, 9], "text": "saludable"}, {"indices": [-1, 16], "text": "healthylifestyle"}, {"indices": [-1, 10], "text": "wholefoods"}, {"indices": [-1, 9], "text": "bienestar"}, {"indices": [-1, 10], "text": "fitsporate"}, {"indices": [-1, 10], "text": "comelimpio"}, {"indices": [-1, 8], "text": "crossfit"}, {"indices": [-1, 7], "text": "healthy"}, {"indices": [-1, 13], "text": "fitnessaddict"}, {"indices": [-1, 11], "text": "picoftheday"}, {"indices": [-1, 6], "text": "dinner"}, {"indices": [-1, 11], "text": "healthcoach"}, {"indices": [-1, 7], "text": "fitness"}, {"indices": [-1, 4], "text": "atun"}, {"indices": [-1, 4], "text": "cena"}, {"indices": [-1, 9], "text": "paleodiet"}, {"indices": [-1, 3], "text": "gym"}, {"indices": [-1, 8], "text": "exercise"}], "photo_loaded": [{"media_url": "http://scontent-b.cdninstagram.com/hphotos-xap1/t51.2885-15/1168857_1557400454473837_59190220_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "Ten\u00eda un rato que no posteaba alguna de mis cenas. Los lunes generalmente no me complico con la cocina porque siempre ando a la carrera con otras cosas, as\u00ed que el domingo en la noche saco a descongelar porciones individuales de prote\u00edna animal y \u00fanicamente las sazono con sal, ajo y alguna hierba de olor. En la cena procuro incluir pescados porque son m\u00e1s digeribles. Hoy toc\u00f3 hamburguesa de lomo de at\u00fan, verduras cocidas y aguacate. En la noche suprimo los carbohidratos (granos, tub\u00e9rculos, leguminosas, fruta) porque son energ\u00eda que ya no necesito tomando en cuenta que unas horas despu\u00e9s me ir\u00e9 a la cama. Esto no es una regla pero es lo recomendable para quienes desean perder grasa o mantener los niveles de \u00e9sta bajos. Lo que si aplica para todos es el cenar ligero para darle chance a nuestro aparato digestivo de descansar durante la noche. Y lo m\u00e1s importante, elegir alimentos NATURALES. Hasta ma\u00f1ana!", "post_url": "http://instagram.com/p/uHWiD_IU44/", "post_user_owner": {"user_owner_id": "317742130", "user_owner_name": "Diana Abreu", "user_owner_screen_name": "dianaabreuhc", "user_owner_url": "https://instagram.com/dianaabreuhc"}}
