{"post_creation_date": "1413250923", "post_id": "830731415995166714_294427442", "post_media": {"hashtags": [{"indices": [1226, 1246], "text": "longevidadesaudavel"}, {"indices": [979, 990], "text": "disciplina"}, {"indices": [1268, 1277], "text": "escolhas"}, {"indices": [1278, 1290], "text": "instahealth"}, {"indices": [0, 23], "text": "dicasantafesuplementos"}, {"indices": [1192, 1208], "text": "qualidadedevida"}, {"indices": [1209, 1225], "text": "habitosaudaveis"}, {"indices": [883, 889], "text": "dieta"}, {"indices": [1259, 1267], "text": "drsaude"}, {"indices": [1247, 1258], "text": "nutrologia"}, {"indices": [326, 331], "text": "doce"}], "photo_loaded": [{"media_url": "http://scontent-a.cdninstagram.com/hphotos-xfa1/t51.2885-15/10735166_570756163053934_487559324_n.jpg"}]}, "post_network": "Instagram", "post_report_status": null, "post_text": "#DicaSantaFeSuplementos from @drsaude --- Nosso corpo gosta daquilo que lhe \u00e9 familiar. Quanto mais de um determinado alimento voc\u00ea o oferecer, mais ele vai te pedir por isso! \nA rec\u00edproca \u00e9 verdadeira, e quanto menos voc\u00ea comer de um alimento, menos seu corpo o cobrar\u00e1 por ele!\n\nEnt\u00e3o por que algu\u00e9m adora doce, porque come #doce! Simples assim! Se deixar de comer, seu corpo aos poucos o far\u00e1 esquecer dele!\n\nPense no seu corpo como um beb\u00ea que chora por saber que ser\u00e1 atendido com algum tipo de acalento. Nesse caso, seu corpo chora por comida e quanto mais voc\u00ea atender a esse choro, mais ele entrar\u00e1 em prantos!! Mas experimente deixar essa crian\u00e7a chorar por um tempo. Mais cedo ou mais tarde ela se adapta \u00e0 aus\u00eancia de resposta e se cala! Da mesma forma seu corpo passar\u00e1 a sentir prazer com o alimento que voc\u00ea escolher! \u00c9 simples assim, e voc\u00ea nunca mais precisar\u00e1 fazer #dieta!! Isso sim \u00e9 reeduca\u00e7\u00e3o alimentar! E educar \u00e9 um processo cont\u00ednuo que exige dedica\u00e7\u00e3o e #disciplina, quem tem filho sabe disso, mas que lhe dar\u00e1 as maiores recompensas de sua vida, e far\u00e1 valer a pena todo sacrif\u00edcio pra tornar o novo h\u00e1bito, natural!! Gostar ou n\u00e3o gostar \u00e9 uma quest\u00e3o de escolha!\n\n#qualidadedevida #habitosaudaveis #longevidadesaudavel #nutrologia #drsaude #escolhas #instahealth", "post_url": "http://instagram.com/p/uHWdJKJi_6/", "post_user_owner": {"user_owner_id": "294427442", "user_owner_name": "SantaFe Suplementos/Vitaminas", "user_owner_screen_name": "santafesuplementos_", "user_owner_url": "https://instagram.com/santafesuplementos_"}}
